function QuizResult(){
    return(
    <>
       <h1>Quiz Result</h1>
       <table className="table">
  <thead>
    <tr>
      <th scope="col">Total Questions</th>
      <td >10</td>
    </tr>
    <tr>
      <th scope="col">Attempted Questions</th>
      <td >8</td>
    </tr>
  </thead>

</table>
    </>
    );
}
export default QuizResult;
